import React, { useState } from"react";


const App=()=>{
    const [list,setlist]=useState("");
    const[item,setitems]=useState([]);

    const onch=(event)=>{
        setlist(event.target.value)
    }

    const store=()=>{
        setitems((prevvalues)=>{
            return[...prevvalues,list];
        })
        setlist("");
        
    }

return(
    <>

    <div className="main_div">
<h1>TODOLIST</h1>
<input type="text" placeholder="enter your plan" value={list}
onChange={onch} />
<ol>
{item.map((val)=>{
   return (<li>{val}</li>)
   })}
</ol>
</div>
<div className="button_arrange">
<button onClick={store}>+</button>
</div>
</>
);

}

export default App;
